import{_ as n}from"./plugin-vue_export-helper-c27b6911.js";import{r,o as d,c as s,a as e,d as t,b as a,e as c}from"./app-b54447e7.js";const i={},p={id:"_13-roman-to-integer",tabindex:"-1"},l=e("a",{class:"header-anchor",href:"#_13-roman-to-integer","aria-hidden":"true"},"#",-1),u={href:"https://leetcode.com/problems/roman-to-integer/",target:"_blank",rel:"noopener noreferrer"},g=c('<p>Roman numerals are represented by seven different symbols: <code>I</code>, <code>V</code>, <code>X</code>, <code>L</code>, <code>C</code>, <code>D</code> and <code>M</code>.</p><table><thead><tr><th>Symbol</th><th>Value</th></tr></thead><tbody><tr><td>I</td><td>1</td></tr><tr><td>V</td><td>5</td></tr><tr><td>X</td><td>10</td></tr><tr><td>L</td><td>50</td></tr><tr><td>C</td><td>100</td></tr><tr><td>D</td><td>500</td></tr><tr><td>M</td><td>1000</td></tr></tbody></table><p>For example, <code>2</code> is written as <code>II</code> in Roman numeral, just two one&#39;s added together. <code>12</code> is written as <code>XII</code>, which is simply <code>X + II</code>. The number <code>27</code> is written as <code>XXVII</code>, which is <code>XX + V + II</code>.</p><p>Roman numerals are usually written largest to smallest from left to right. However, the numeral for four is not <code>IIII</code>. Instead, the number four is written as <code>IV</code>. Because the one is before the five we subtract it making four. The same principle applies to the number nine, which is written as <code>IX</code>. There are six instances where subtraction is used:</p><ul><li><code>I</code> can be placed before <code>V</code> (5) and <code>X</code> (10) to make 4 and 9.</li><li><code>X</code> can be placed before <code>L</code> (50) and <code>C</code> (100) to make 40 and 90.</li><li><code>C</code> can be placed before <code>D</code> (500) and <code>M</code> (1000) to make 400 and 900.</li></ul><p>Given a roman numeral, convert it to an integer.</p><p><strong>Example 1:</strong></p><p><strong>Input:</strong> s = &quot;III&quot;</p><p><strong>Output:</strong> 3</p><p><strong>Example 2:</strong></p><p><strong>Input:</strong> s = &quot;IV&quot;</p><p><strong>Output:</strong> 4</p><p><strong>Example 3:</strong></p><p><strong>Input:</strong> s = &quot;IX&quot;</p><p><strong>Output:</strong> 9</p><p><strong>Example 4:</strong></p><p><strong>Input:</strong> s = &quot;LVIII&quot;</p><p><strong>Output:</strong> 58</p><p><strong>Explanation:</strong> L = 50, V= 5, III = 3.</p><p><strong>Example 5:</strong></p><p><strong>Input:</strong> s = &quot;MCMXCIV&quot;</p><p><strong>Output:</strong> 1994</p><p><strong>Explanation:</strong> M = 1000, CM = 900, XC = 90 and IV = 4.</p><h2 id="constraints" tabindex="-1"><a class="header-anchor" href="#constraints" aria-hidden="true">#</a> Constraints</h2><ul><li><code>1 &lt;= s.length &lt;= 15</code></li><li><code>s</code> contains only the characters <code>(&#39;I&#39;, &#39;V&#39;, &#39;X&#39;, &#39;L&#39;, &#39;C&#39;, &#39;D&#39;, &#39;M&#39;)</code>.</li><li>It is <strong>guaranteed</strong> that <code>s</code> is a valid roman numeral in the range <code>[1, 3999]</code>.</li></ul>',25);function h(m,I){const o=r("ExternalLinkIcon");return d(),s("div",null,[e("h1",p,[l,t(),e("a",u,[t("13. Roman to Integer"),a(o)])]),g])}const b=n(i,[["render",h],["__file","index.html.vue"]]);export{b as default};
